import logo from './logo.svg';
import React from 'react';
import './App.css';



const App = () => {
  return (
    <div className="App">

      <header className='header'>
        <img src='https://upload.wikimedia.org/wikipedia/commons/thumb/2/2f/Logo_TV_2015.svg/800px-Logo_TV_2015.svg.png' />

      </header>
      <nav>
        <div>Profile</div>
        <div>News Feed</div>
      </nav>
      <div>MAIN CONTENT</div>
    </div>
  );
}





export default App;
